    setUpGeoJSON() {

        this.geoJSON = {
            id: 'geoJSON',
            name: 'geoJSON map',
            enabled: true,
            layer: geoJSON (
                (this.geoJSONData) as any,
                {
                    style: function (feature) {
                        return {
                            stroke: false,
                            fill: true,
                            fillOpacity: 1,
                            fillColor: feature.properties.fillColour
                        }
                    }
                }
            )
        }

        this.options = {
            zoom: 0,
            zoomSnap: 0,
            center: latLng(41.8719, 6.5674),
            layers: [
                this.geoJSON.layer
            ]
        };
    }

    onMapReady(map: Map) {
        this.map = map;
        map.touchZoom.disable();
        map.doubleClickZoom.disable();
    }

